css:
.php-atom-autocomplete-strike,
.php-atom-autocomplete-strike .word {
  text-decoration: line-through;
}
.php-atom-autocomplete-goto-overlay {
  width: 100%;
  margin-left: -50%;
}
.php-atom-autocomplete-popover {
  max-width: 45%;
}
.php-atom-autocomplete-popover .php-atom-autocomplete-popover-wrapper {
  margin: 0em 0em 0em 0em;
  text-align: left;
}
.php-atom-autocomplete-popover .php-atom-autocomplete-popover-wrapper div {
  white-space: normal;
}
.php-atom-autocomplete-popover .php-atom-autocomplete-popover-wrapper .section > h4 {
  margin-top: 1em;
  font-size: larger;
  font-weight: bold;
}
.php-atom-autocomplete-popover .php-atom-autocomplete-popover-wrapper .section > div {
  padding-left: 1em;
}
.php-atom-autocomplete-popover .php-atom-autocomplete-popover-wrapper .section td {
  vertical-align: top;
}
.php-atom-autocomplete-popover .php-atom-autocomplete-popover-wrapper .section td:not(:last-child) {
  padding-right: 1em;
}
atom-text-editor .comment-clickable .region,
atom-text-editor::shadow .comment-clickable .region {
  pointer-events: all;
  z-index: 9999;
}
atom-text-editor .gutter .line-number.override .icon-right,
atom-text-editor::shadow .gutter .line-number.override .icon-right {
  opacity: 1.0;
  cursor: pointer;
  visibility: visible;
}
atom-text-editor .gutter .line-number.override .icon-right:before,
atom-text-editor::shadow .gutter .line-number.override .icon-right:before {
  content: "\f05c";
  color: #0098ff;
}
atom-text-editor .gutter .line-number.implementation .icon-right,
atom-text-editor::shadow .gutter .line-number.implementation .icon-right {
  opacity: 1.0;
  cursor: pointer;
  visibility: visible;
}
atom-text-editor .gutter .line-number.implementation .icon-right:before,
atom-text-editor::shadow .gutter .line-number.implementation .icon-right:before {
  content: "\f05c";
  color: #ff4800;
}
